/**
 * ✔ type
 * ✔ size
 * ✔ color
 */
import { JSX, forwardRef, useRef } from 'react'
import { Text, TextStyle, Image } from 'react-native'
import useInnerProps from './getInnerListeners'
import useNodesRef, { HandlerRef } from './useNodesRef'
import { useLayout, useTransformStyle } from './utils'

export type IconType =
  | 'success'
  | 'success_no_circle'
  | 'info'
  | 'warn'
  | 'waiting'
  | 'cancel'
  | 'download'
  | 'search'
  | 'clear'

export interface IconProps {
  type: IconType
  size?: number
  color?: string
  style?: TextStyle & Record<string, any>
  'enable-offset'?: boolean
  'enable-var'?: boolean
  'external-var-context'?: Record<string, any>
  'parent-font-size'?: number
  'parent-width'?: number
  'parent-height'?: number
}

const IconTypeMap = new Map<IconType, string>([
  ['success', 'data:image/png;base64,'],
  ['success_no_circle', 'data:image/png;base64,'],
  ['info', 'data:image/png;base64,'],
  ['warn', 'data:image/png;base64,'],
  ['waiting', 'data:image/png;base64,'],
  ['cancel', 'data:image/png;base64,'],
  ['download', 'data:image/png;base64,'],
  ['search', 'data:image/png;base64,'],
  ['clear', 'data:image/png;base64,']
])

const Icon = forwardRef<HandlerRef<Text, IconProps>, IconProps>(
  (props, ref): JSX.Element => {
    const {
      type,
      size = 23,
      color,
      style = {},
      'enable-var': enableVar,
      'external-var-context': externalVarContext,
      'parent-font-size': parentFontSize,
      'parent-width': parentWidth,
      'parent-height': parentHeight
    } = props

    const uri = IconTypeMap.get(type)

    const defaultStyle = { width: ~~size, height: ~~size }

    const styleObj = {
      ...defaultStyle,
      ...style
    }

    const {
      hasSelfPercent,
      normalStyle,
      setWidth,
      setHeight
    } = useTransformStyle(styleObj, { enableVar, externalVarContext, parentFontSize, parentWidth, parentHeight })

    const nodeRef = useRef(null)
    useNodesRef(props, ref, nodeRef, { defaultStyle })

    const { layoutRef, layoutStyle, layoutProps } = useLayout({ props, hasSelfPercent, setWidth, setHeight, nodeRef })

    const innerProps = useInnerProps(
      props,
      {
        ref: nodeRef,
        style: {
          ...normalStyle,
          ...layoutStyle,
          tintColor: color
        },
        source: { uri },
        ...layoutProps
      },
      [],
      {
        layoutRef
      }
    )

    return <Image {...innerProps} />
  }
)

Icon.displayName = 'MpxIcon'

export default Icon
